using Pumas # branch mt/corr_cholesky3
using DataFramesMeta

iv_2cmt_macro_ir1 = @model begin
  @param begin
    tvcl ~ truncated(Cauchy(0, 2), 0, Inf)
    tvq ~ truncated(Cauchy(0, 2), 0, Inf)
    tvvc ~ truncated(Cauchy(0, 10), 0, Inf)
    tvvp ~ truncated(Cauchy(0, 20), 0, Inf)
    tvkin ~ truncated(Cauchy(0, 100), 0, Inf)
    tvkout ~ truncated(Cauchy(0, 2), 0, Inf)
    tvic50 ~ truncated(Cauchy(0, 5), 0, Inf)
    σ_p ~ truncated(Normal(0, 0.5), 0, Inf)
    σ_a ~ truncated(Normal(0, 1.0), 0, Inf)
    σ_PD ~ truncated(Normal(0, 0.4), 0, Inf)
    C ~ LKJCholesky(4, 2.0)
    ω ∈ Constrained(
      MvNormal(zeros(4), Diagonal(0.4^2 * ones(4))),
      lower=zeros(4),
      upper=fill(Inf, 4),
      init=ones(4),
    )
    C_PD ~ LKJCholesky(3, 0.2)
    ω_PD ∈ Constrained(
      MvNormal(zeros(3), Diagonal(0.4^2 * ones(3))),
      lower=zeros(3),
      upper=fill(Inf, 3),
      init=ones(3),
    )
  end

  @random begin
    ηstd ~ MvNormal(I(4))
    ηstd_PD ~ MvNormal(I(3))
  end

  @pre begin
    η = ω .* (getchol(C).L * ηstd)
    η_PD = ω_PD .* (getchol(C_PD).L * ηstd_PD)
    CL = tvcl * exp(η[1])
    Q = tvq * exp(η[2])
    Vc = tvvc * exp(η[3])
    Vp = tvvp * exp(η[4])
    Kin = tvkin * exp(η_PD[1])
    Kout = tvkout * exp(η_PD[2])
    ic50 = tvic50 * exp(η_PD[3])
    imax = 1.0
    hill = 1.0
  end

  @init begin
    Resp = Kin / Kout
  end

  @vars begin
    inh = (imax * ((Central / Vc)^hill)) / ((ic50^hill) + ((Central / Vc)^hill))
  end

  @dynamics begin
    # Depot' = -Ka * Depot                                          # KA is 0 in Torsten
    # Central' = ka * Depot - (ke + k_cp) * Central + k_pc * Periph # KA is 0 in Torsten
    Central' = -(CL / Vc) * Central + (Q / Vp) * Peripheral - (Q / Vc) * Central
    Peripheral' = (Q / Vc) * Central - (Q / Vp) * Peripheral
    Resp' = (Kin * (1 - inh)) - (Kout * Resp)
  end

  @derived begin
    conc := @. Central / Vc
    resp := Resp
    # censoring for lloq and bloq
    dv_PK ~ @. censored(truncated(Normal(log(conc), sqrt(σ_a^2 + (conc * σ_p)^2)), 0, Inf), 0.5, Inf)
    dv_PD ~ @. censored(LogNormal(log(resp), sqrt(σ_PD)), 3.0, Inf)
  end
end

